import React from "react";

function SignUpSuccessful() {
  return (
    <div className="popup">
      <div className="popup-content">
        <h2>Thank you</h2>
        <img src="" alt="Success" />
        <p>You have been successfully signed up.</p>
        <button>Back to Login Page</button>
      </div>
    </div>
  );
}

export default SignUpSuccessful;
